webpackJsonp([0x74d0fb19f8f6],{5187:function(e,t){e.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/01/papatrooper.gif" height="139" width="82" border="0" alt="papatrooper.gif: " /><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/01/mamatrooper.gif" height="139" width="76" border="0" alt="mamatrooper.gif: " /></p>\n<p>This is what PapaScott thinks we look like as <a href="http://www.stor.co.uk/troopers.php">Stor Troopers</a>. (First noticed at <a href="http://singbluesilver.manilasites.com/">Sing Blue Silver</a>.)</p>\n<p>Whoa, we\'re still trying get our bodies and souls into the rhythm of DIOKODC (double income, one kid on day care).&nbsp;Right now we\'re mostly tired and sometimes a little frustrated.&nbsp;So our postings have been on the lean side of between slim and none the past few days. We\'ll get over it.</p>\n<p>At least Mama has a job title now. Department Head Operations, the more challenging of the options. A job she\'s done before, but then there were fewer stores, fewer&nbsp;problems,&nbsp;and no BSE.</p>',fields:{title:"Where Did Our Love Go?",date:"11 Jan 2001",url:"https://papascott.de/2001-01-11-where-did-our-love-go/"}}},pathContext:{slug:"/2001-01-11-where-did-our-love-go/",prev:{fields:{title:"Sleeping Vertically",date:"06 Jan 2001",slug:"/2001-01-06-sleeping-vertically/"}},next:{fields:{title:"Letter Home",date:"13 Jan 2001",slug:"/2001-01-13-letter-home/"}}}}}});
